const Difficulty = () => {
    return (
        <div>
            <h1>Choose Difficulty</h1>
            <div>
                <button className="easyButton">Film</button>
                <button className="hardButton">Sport</button>
                <button className="legendary">Biologi</button>
            </div>
        </div>
    )
}

export default Difficulty;
